function showResults(){var e=(endTime-startTime)/1e3,n=8*downloadSize,t=Math.round(n/e);try{var d=new XMLHttpRequest;d.open("GET","/wp-content/plugins/mhm-speedtest/speed.php?bps="+t+"&_"+Math.random(),!0),d.send()}catch(a){}}var startTime=(new Date).getTime(),endTime,imageAddr="/wp-content/plugins/mhm-speedtest/assets/speed.png?n="+Math.random(),downloadSize=1441,download=new Image;download.src=imageAddr,download.onload=function(){endTime=(new Date).getTime(),showResults()};